import * as React from 'react';
import PropTypes from 'prop-types';
import Tabs from '@material-ui/core/Tabs';
import Tab from '@material-ui/core/Tab';
import Typography from '@material-ui/core/Typography';
import Box from '@material-ui/core/Box';
import FormControl  from '@material-ui/core/FormControl';
import { FormHelperText, Input, InputLabel } from '@material-ui/core';




export default function Register(){
    return(
        <Box>
            <FormControl required style={{marginTop: 30}} className='fromunit'>
                <InputLabel htmlFor="my-input">First Name</InputLabel>
                <Input required id="my-input1" aria-describedby="my-helper-text" />
            </FormControl><br/> 
            <FormControl required className='fromunit'>
                <InputLabel htmlFor="my-input">Last Name</InputLabel>
                <Input required id="my-input2" aria-describedby="my-helper-text" />
            </FormControl><br/> 
            <FormControl required className='fromunit'>
                <InputLabel htmlFor="my-input">Email</InputLabel>
                <Input required id="my-input3" aria-describedby="my-helper-text" />
            </FormControl><br/> 
            <FormControl required className='fromunit'>
                <InputLabel htmlFor="my-input">Password</InputLabel>
                <Input required id="my-input4" aria-describedby="my-helper-text" />
            </FormControl><br/>  
            <FormControl style={{marginBottom: 30}} required className='fromunit'>
                <InputLabel htmlFor="my-input">Contact No.</InputLabel>
                <Input  required id="my-input4" aria-describedby="my-helper-text" />
            </FormControl><br/> 
        </Box>
    )
}
